import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import logo from "../../images/logo.png";
import "./SignUp.css";

function SignUp() {
  const signUpdata = async () => {
    const response = await fetch("http://localhost:6969/data");
    const data = await response.json();
    console.log(data);
  };

  useEffect(() => {
    signUpdata();
  });

  return (
    <div className="signUp">
      <div className="form-container">
        <div className="form">
          <img src={logo} className="signUplogo" alt="" />
          <p className="loginPara">
            SignUp to see video and photos <br /> from your friend
          </p>
          <div className="">
            <input
              type="text"
              name="email"
              id="email"
              placeholder="enter your email"
            />
          </div>
          <div className="">
            <input type="text" name="name" id="name" placeholder="Full Name" />
          </div>
          <div className="">
            <input
              type="text"
              name="username"
              id="username"
              placeholder="User Name"
            />
          </div>
          <div className="">
            <form action="">
              <input
                type="password"
                name="password"
                id="password"
                placeholder="Password"
              />
            </form>
          </div>
          <p
            className="loginPara"
            style={{ fontSize: "13px", margin: "3px 0px " }}
          >
            By Signin up, you agree to our Terms , <br />
            privacy policy and coockies policy.
          </p>
          <input type="submit" id="submit-btn" value="Sign Up" />
        </div>
        <div className="form2">
          Already have an Account ?
          <Link to="/signin">
            <span style={{ color: "blue", cursor: "pointer" }}>Sign In</span>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default SignUp;
